/**
 * Created by Lenovo on 2019/9/4.
 */
/**
 * Created by Lenovo on 2019/9/2.
 */
import React from 'react';
import './personal.css';
import {Title,Card} from '../../share';
import publish from "../../images/personal/publish.png";
import chat from '../../images/personal/chat.png';
import {getData, goNext,getTimeFormat,getTimeHour} from '../../utils';
export default class MyPurchase extends React.Component {
    constructor(props) {
        super(props);
        this.item = this.props.history.location.state ||{};
        console.log(this.item);
        this.count = 0;
        this.state = {
            dataList:[],
            index:0,
            value:null
        }
    }
    componentDidMount(){
        this.goLogin();
        this.getMyProductList(1);
    }
    goLogin(){
        getData({
            method: 'post',
            url: 'getChatList',
            data: {},
            successCB: (res) => {
                console.log(res);
            }
        })
    }
    changeState(e){
        console.log(e);
        this.setState({
            value:e.target.value
        })
    }
    getMyProductList(){
        getData({
            method: 'post',
            url: 'getMyProductList',
            data: {
                type:3
            },
            successCB: (res) => {
                this.setState({
                    dataList:res.result.list
                })
                console.log(res);
            }
        })
    }
    onLeftClick(){
        this.props.history.goBack()
    }
    goDetail(e,item){
        e.stopPropagation();
        goNext(this,"indexDetail",item);
    }
    delProduct(e,item){
        e.stopPropagation();
        getData({
            method: 'post',
            url: 'delProduct',
            data: {
                productId:item.id
            },
            successCB: (res) => {
                console.log(res);
                if(res.code == 0){
                    this.getMyProductList();
                }
            }
        })
    }
    render() {
        var user = JSON.parse(localStorage.getItem("userInfo"))||{};
        return <div>
            <Title title="我买到的" onLeftClick={this.onLeftClick.bind(this)} className="cm-bc-white"/>
            <div>
                <div className="cm-ptb-018 cm-p-018 cm-bc-white">
                    <div className="cm-flex cm-ai-c" onClick={() => this.goNextPage()}>
                        <img src={publish} alt="" className="cm-img-04 cm-border-radius-half"/>
                        <div className="cm-c-999 cm-ml-018 cm-fs-026">我买到的宝贝共<span className="cm-c-main cm-fs-028"> {this.state.dataList.length} </span>件</div>
                    </div>
                </div>
                <div className="cm-plr-018">
                    {this.state.dataList.length>0?this.state.dataList.map((item,index)=>{
                            var productImgs = item.productImgs && item.productImgs.split(",");
                            var desc = item.productDesc && item.productDesc.slice(0,28);
                            return(
                                <Card key={index} onClick={()=>goNext(this,"indexDetail",item)}>
                                    <div className="cm-flex cm-jc-sb cm-ai-c cm-plr-009 cm-ptb-018">
                                        <div className="cm-flex cm-ai-c">
                                            <img src={productImgs[0]} alt="" className="cm-img-14"/>
                                            <div className="cm-ml-018 cm-flex-1">
                                                <div className="cm-c-333 cm-fs-026">{desc}</div>
                                                <div className="cm-c-main cm-fs-030 cm-mt-018">￥{item.productPrice}</div>
                                                <div className="cm-c-999 cm-pt-018 cm-fs-022">{getTimeFormat(item.createTime)}</div>
                                            </div>
                                        </div>
                                    </div>
                                    <div className="cm-flex cm-ai-c cm-ptb-018 cm-border-top-eee cm-jc-fe">

                                        <div className="cm-btn-border-333 cm-flex cm-ai-c cm-mr-018" onClick={(e)=>this.goDetail(e,item)}>
                                            <span className="cm-fs-028">查看</span>
                                        </div>
                                        <div className="cm-btn-border-333 cm-flex cm-ai-c cm-mr-018" onClick={(e)=>this.delProduct(e,item)}>
                                            <span className="cm-fs-028">删除</span>
                                        </div>
                                    </div>
                                </Card>
                            )
                        }):
                        <div className="cm-c-666 cm-tx-c cm-mt-080">
                            <div>你还没有买到任何发布宝贝哦！</div>
                            <div className="cm-mt-036" onClick={()=>goNext(this,'index')}>
                                <span className="cm-btn-main">去逛逛</span>
                            </div>
                        </div>
                    }
                </div>
            </div>
        </div>
    }
}
